import React from "react";
import { Text, Heading } from "@chakra-ui/react"

const Home = () => {
  return (<div>
            <Heading as="h2" size="2xl"> Gilroy! </Heading >
            <Text>Hello</Text>
        </div>)

}
export default Home;
